import unittest
from typing import List


class Solution:
    @staticmethod
    def find_anagrams(s: str, p: str) -> List[int]:
        """
        Given a string s and a non-empty string p, find all the start indices of p's anagrams in s.
        Strings consists of lowercase English letters only and the length of both strings s and p will not be larger than 20, 100.
        The order of output does not matter.

        Example 1:
        Input:
        s: "cbaebabacd" p: "abc"
        Output:
        [0, 6]

        Explanation:
        The substring with start index = 0 is "cba", which is an anagram of "abc".
        The substring with start index = 6 is "bac", which is an anagram of "abc".

        Example 2:
        Input:
        s: "abab" p: "ab"
        Output:
        [0, 1, 2]

        Explanation:
        The substring with start index = 0 is "ab", which is an anagram of "ab".
        The substring with start index = 1 is "ba", which is an anagram of "ab".
        The substring with start index = 2 is "ab", which is an anagram of "ab".
        """
        from collections import defaultdict

        p_length = len(p)

        p_dict = defaultdict(int)
        for ch in p:
            p_dict[ch] += 1

        window_dict = defaultdict(int)
        for ch in s[:p_length]:
            window_dict[ch] += 1

        # Resulting list
        result = []

        for index in range(len(s) - p_length + 1):
            if window_dict == p_dict:
                result.append(index)
            target_char = s[index]
            window_dict[target_char] -= 1
            if window_dict[target_char] == 0:
                del window_dict[target_char]
            if index + p_length < len(s):
                window_dict[s[index + p_length]] += 1

        return result


class FindAllAnagramsInAStringUnittest(unittest.TestCase):

    def test_case_1(self):
        s = "cbaebabacd"
        p = "abc"
        self.assertListEqual([0, 6], Solution.find_anagrams(s, p))

    def test_case_2(self):
        s = "abab"
        p = "ab"
        self.assertListEqual([0, 1, 2], Solution.find_anagrams(s, p))

    def test_case_3(self):
        s = "baa"
        p = "aa"
        self.assertListEqual([1], Solution.find_anagrams(s, p))

    def test_case_4(self):
        s = "ababababab"
        p = "aab"
        self.assertListEqual([0, 2, 4, 6], Solution.find_anagrams(s, p))

    def test_case_5(self):
        s = ""
        p = ""
        self.assertListEqual([0, 10001], Solution.find_anagrams(s, p))

    def test_case_6(self):
        s = "aaaaaa"
        p = "aaa"
        self.assertListEqual([0, 1, 2, 3], Solution.find_anagrams(s, p))